import { Button, Form, Modal } from "react-bootstrap";

const NoteModal =(props)=> {
    const {show, onHide, isEdit} = props;

    return(
        <Modal
            show={show}
            onHide={onHide}
            centered={true}
            backdrop='static'
            keyboard={false}
        >
            <Modal.Header closeButton>
                <Modal.Title>{(isEdit)? 'Edit Note' : 'Create Note' }</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <Form>

                </Form>
            </Modal.Body>
            <Modal.Footer>
                <Button>Cancel</Button>
                <Button>Save</Button>
            </Modal.Footer>
        </Modal>
    );
}

export default NoteModal;
